import React, { Fragment, useState } from "react";
import { Autocomplete, TextField } from "@mui/material";
import { IMovie } from "../interfaces/movieInterface";
import movieImage from "../images/movieIMG.jpeg";
export const SearchBar = () => {
  const [suggestions, setSuggestions] = useState();
  const [movieData, setMovieData] = useState<IMovie[]>([
    {
      id: 100,
      title: "Iron pony",
      description: "asdklfjsalkjdf",
      rating: 2,
      numberOfVotes: 1,
    },
    {
      id: 200,
      title: "Spaceglider",
      description: "space gliding monkeys",
      rating: 10,
      numberOfVotes: 3,
    },
  ]);

  const handleSelect = (event: any, value: any) => {
    console.log(value);
  };

  return (
    <>
      <Autocomplete
        freeSolo
        id="free-solo"
        disableClearable
        sx={{ width: 300 }}
        options={movieData}
        getOptionLabel={(option) => option.title}
        renderOption={(props, option) => (
          <Fragment>
            <span style={{ cursor: "pointer" }}>
              <img src={movieImage} width="50" height="50"></img>
            </span>
            {option.title}
          </Fragment>
        )}
        renderInput={(params) => (
          <TextField
            {...params}
            label="Movie"
            InputProps={{
              ...params.InputProps,
              type: "search",
            }}
          />
        )}
        onChange={(event, value) => handleSelect(event, value)}
      />
    </>
  );
};
